import Image4 from "../../assets/images/metaSai/metaProject4.svg";

const dataItem = [
  {
    id: 1,
    img: Image1,
    title: "서먼러쉬",
  },
  {
    id: 2,
    img: Image2,
    title: "한컴 말랑말랑 플랫폼",
  },
  {
    id: 3,
    img: Image3,
    title: "현대차 VR 프로젝트",
  },
  {
    id: 4,
    img: Image4,
    title: "라이커",
  }
];

export default dataItem;
